import {Dialog, showDialog} from "@jupyterlab/apputils";

import {IFileBrowserFactory} from "@jupyterlab/filebrowser";

import {ILauncher} from "@jupyterlab/launcher";

import {IMainMenu} from "@jupyterlab/mainmenu";

import {ServerConnection} from "@jupyterlab/services";

import {Widget} from "@lumino/widgets";

import "../style/index.css";

let templates;

export class OpenTemplateWidget extends Widget {
  constructor() {
    const body = document.createElement("div");
    const label = document.createElement("label");
    label.textContent = "Template:";

    const package_input = document.createElement("select");
    const notebook_input = document.createElement("select");

    Object.keys(templates).forEach((package_name) => {
      const package_option = document.createElement("option");
      package_option.label = package_name;
      package_option.text = package_name;
      package_option.value = package_name;
      package_input.appendChild(package_option);
    });

    const fill = (package_name) => {
      while (notebook_input.lastChild) {
        notebook_input.removeChild(notebook_input.lastChild);
      }

      templates[package_name].forEach((notebook) => {
        const notebook_option = document.createElement("option");
        notebook_option.label = notebook.name;
        notebook_option.text = notebook.name;
        notebook_option.value = notebook.name;
        notebook_input.appendChild(notebook_option);
      });
    };

    package_input.addEventListener("change", (event) => {
      const package_name = event.target.value;
      fill(package_name);
    });

    if (Object.keys(templates).length > 0) {
      fill(Object.keys(templates)[0]);
    }

    body.appendChild(label);
    body.appendChild(package_input);
    body.appendChild(notebook_input);
    super({node: body});
  }

  getValue = () => this.node.getElementsByTagName("select")[1].value;
}

async function activate(app, menu, browser, launcher) {
  // grab templates from serverextension
  const settings = ServerConnection.makeSettings();
  const res = await ServerConnection.makeRequest(`${settings.baseUrl}templates/names`, {}, settings);
  if (res.ok) {
    const template_data = await res.json();
    templates = template_data.templates;
    const templateLabel = template_data.template_label || "Template";

    if (Object.keys(templates).length > 0) {
      // Add an application command
      const open_command = "template:open";

      app.commands.addCommand(open_command, {
        caption: "Initialize a notebook from a template notebook",
        execute: () => {
          showDialog({
            body: new OpenTemplateWidget(),
            buttons: [Dialog.cancelButton(), Dialog.okButton({label: "GO"})],
            focusNodeSelector: "input",
            title: templateLabel,
          }).then(async (result) => {
            if (result.button.label === "Cancel") {
              return;
            }
            if (result.value) {
              const res2 = await ServerConnection.makeRequest(`${settings.baseUrl}templates/get?${new URLSearchParams({template: result.value})}`, {}, settings);
              const data = await res2.json();
              const {path} = browser.tracker.currentWidget.model;

              const ext = data.filename.split(".").pop().toLowerCase();
              const isNotebook = ext === "ipynb";
              const model = await app.commands.execute("docmanager:new-untitled", {ext, path, type: isNotebook ? "notebook" : "file"});
              const widget = await app.commands.execute("docmanager:open", {factory: isNotebook ? "Notebook" : null, path: model.path});
              // eslint-disable-next-line no-param-reassign
              widget.isUntitled = true;
              await widget.context.ready;
              if (isNotebook) {
                widget.model.fromString(data.content);
              } else {
                widget.content.editor._editor.setValue(data.content);
              }
            }
          });
        },
        iconClass: "jp-TemplateIcon",
        isEnabled: () => true,
        label: templateLabel,
      });

      // Add a launcher item if the launcher is available.
      if (launcher) {
        launcher.add({
          args: {isLauncher: true, kernelName: "template"},
          category: "Notebook",
          command: open_command,
          // eslint-disable-next-line max-len
          kernelIconUrl:
            // eslint-disable-next-line max-len
            "data:image/png;base64,",
          rank: 1,
        });
      }

      if (menu) {
        // Add new text file creation to the file menu.
        menu.fileMenu.newMenu.addGroup([{command: open_command}], 40);
      }
    } else {
      // eslint-disable-next-line no-console
      console.log("No JupyterLab templates available!");
    }
  }

  // eslint-disable-next-line no-console
  console.log("JupyterLab extension jupyterlab_templates is activated!");
}

const extension = {
  activate,
  autoStart: true,
  id: "jupyterlab_templates",
  optional: [ILauncher],
  requires: [IMainMenu, IFileBrowserFactory],
};

export default extension;
export {activate as _activate};
